import React from 'react'
import LessonCard from './LessonCard'
import cardData from '../cardData'

const LessonCardSection = () => {
  return (
    <section className='lesson-card-section'>
        <h2>Section</h2>
        {cardData.map(card => {
            return <LessonCard />
        })}
    </section>
  )
}

export default LessonCardSection
